import React from "react";
import "../App.css";

import { AppHeader } from "./AppHeader";
import { AppBody } from "./AppBody";
import { AppContainer } from "../state";
import { Overlay } from "./Overlay";

function App() {
  return (
    <AppContainer>
      {({
        mediaSelected,
        onMediaChange,
        watch,
        listen,
        onSearchQuery,
        getWatchData,
        getListenData,
        setSearchQuery,
        searchQuery,
        openOverlayID,
        setOpenOverlayID,
        openOverlayCategory,
        setOpenOverlayCategory,
      }) => (
        <div className="App">
          <AppHeader
            mediaSelected={mediaSelected}
            onSearchQuery={onSearchQuery}
            getWatchData={getWatchData}
            getListenData={getListenData}
            setSearchQuery={setSearchQuery}
          />
          <Overlay
            media_id={openOverlayID}
            media_category={openOverlayCategory}
            experience={mediaSelected}
            watchData={watch}
            listenData={listen}
          />
          <AppBody
            mediaSelected={mediaSelected}
            onMediaChange={onMediaChange}
            onSearchQuery={onSearchQuery}
            getWatchData={getWatchData}
            getListenData={getListenData}
            watch={watch}
            listen={listen}
            setSearchQuery={setSearchQuery}
            searchQuery={searchQuery}
            setOpenOverlayID={setOpenOverlayID}
            setOpenOverlayCategory={setOpenOverlayCategory}
          />
        </div>
      )}
    </AppContainer>
  );
}

export default App;
